import React from 'govuk-react';
import { Page } from 'govuk-react';
import { TopNav } from '@govuk-react/top-nav';

function MyHeader() {
    return (



        <Page header={< TopNav company=
            {<TopNav.Anchor href="https://mycartaxcal.com" target="new">
                <TopNav.IconTitle icon={<img src="mainlogo.jpg" width="24" height="24" alt="" />}>
                    Medical Records
                </TopNav.IconTitle>
            </TopNav.Anchor>} />}>

        </Page>

    );

}


export default MyHeader;
